er failed to get access to a resource. The most likely error they received was an access denied or error 5.</p>','2020-12-27 09:27:28','2020-12-27 09:27:28'),(98,151,25,'<p>Kerberos service tickets are obtained by a client and passed to a server to gain access to resources on that server. They\'re signed using a secret which only that server that has the resource being requested can decrypt. When the SPN is on the wrong account in Active Directory the secret that is used is the one of the accounts the SPN is on instead of the one of the servers.</p><p>As a result, the server can\'t decrypt the ticket and gives back an error to the client.</p>','2020-12-27 09:27:39','2020-12-27 09:27:39'),(99,151,25,'<h2>Resolution</h2><p>To resolve this issue, the service principal name must be searched for and removed from the alternative account and then it must be added to the correct account in Active Directory. To do that follow these steps:</p><ol><li><p>At an elevated command prompt and using Enterprise Administrator credentials, run the command <code>setspn -Q &lt;SPN&gt;</code>. This will return a computer name. SetSPN.exe is installed with the Active Directory Directory Services role or with RSAT.</p></li><li><p>Remove the incorrectly registered SPN by going to the command prompt and running the command <code>setspn -D &lt;SPN&gt; &lt;computername&gt;</code>.</p></li><li><p>Add the SPN to the correct account at the command prompt by running the command <code>setspn -A &lt;SPN&gt; &lt;computername of computer which had the System event 4&gt;</code>.</p></li></ol>','2020-12-27 09:27:52','2020-12-27 09:27:52'),(100,153,24,'<p>Test again the ticket history logs.</p>','2020-12-30 13:48:24','2020-12-30 13:48:24'),(101,152,25,'<p>dfgaegr</p>','2020-12-30 14:21:53','2020-12-30 14:21:53'),(102,156,25,'<p><img src=\"data:image/png;base64,\" alt=\"Screenshot 2020-09-25 at 15.38.41.png\"></p><p></p><p></p><p></p>','2021-01-03 10:28:04','2021-01-03 10:28:04'),(103,155,25,'<p>ofjiewfjowefw</p>','2021-01-04 13:05:02','2021-01-04 13:05:02'),(104,155,25,'<p>ofjiewfjowefw</p>','2021-01-04 13:05:05','2021-01-04 13:05:05'),(105,176,24,'<p>Guten Tag Frau Schwyzer,</p><p>Wie geht es Ihnen?</p><p>Grüsse</p><p>SP</p>','2021-01-05 11:31:48','2021-01-05 11:31:48'),(106,176,280,'<p>Guten Tag,</p><p>Ja, bestens. Danke, hoffe Ihnen auch.</p><p>Freundliche Grüsse,</p><p>SS</p>','2021-01-05 11:34:16','2021-01-05 11:34:16'),(107,173,25,'<p>Hi Marcel, please can you attach a print  screen of the error that you are getting? </p><p>We are having trouble to simulate the error. </p><p>Thanks</p><p>SC</p><p>INAX AG</p>','2021-01-06 12:21:08','2021-01-06 12:21:08'),(108,171,25,'<p>siodfhjdosfjeirhfg</p><hr><br><p>Sarka Cahakova <br>on behalf of <br>Lennard A. Kruger <br>Geschäftsleitung <br><br><strong>INAX SCHWEIZ </strong><br>Alarmserver Management - Notfallpläne &amp; Security Specialists <br><br>Office Cham / Schweiz <br>Riedstrasse 13, 6330 Cham <br>T. +41 41 560 3737 <br>Web: https://inax.ch <br>Email: office@inax247.com <br><br>Diese E-Mail enthält vertrauliche und/oder rechtlich geschützte Informationen. Wenn Sie nicht der richtige Adressat sind oder diese Email irrtümlich erhalten haben, informieren Sie bitte sofort den Absender und vernichten Sie diese E-Mail. Das unerlaubte Kopieren sowie die unbefugte Weitergabe dieser E-Mail ist nicht gestattet.</p>','2021-01-08 14:13:28','2021-01-08 14:13:28'),(109,169,23,'<p>test reply</p><hr><br><p><s>test</s> <strong>test</strong> <em>test</em></p>','2021-01-08 14:14:05','2021-01-08 14:14:05'),(110,180,226,'From / Name:\r\nMaria \r\n\r\nFirm / Organisation:\r\nBulgar\r\n\r\nPhone: 34646464\r\nMobile: 45646456446 \r\n\r\nEmail:\r\n<testtheultimatetester@mailforspam.com>\r\n\r\nTicket Escalation:\r\nModerate \r\n\r\nSoftware/Hardware affected:\r\nBACnet-WAGO\r\n\r\nWhich Version:\r\nixArma 3\r\n\r\nLast Update:\r\n2019\r\n\r\nBriefly describe your problem:\r\n* * * test ticket * * * \r\nmy installation of updates got stuck 