0-indestructible\" style=\"box-sizing: border-box; font-family: inherit; text-decoration: none; color: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;\" class=\"\">virtual indestructibility</a>&nbsp;on Earth. The creatures can survive intense pressures, huge doses of radiation, and years of being dried out.</div><div style=\"box-sizing: inherit; font-family: &quot;PT Serif&quot;, Georgia, serif; margin: 0px 0px 0.6875rem; padding: 0px; border: 0px; vertical-align: baseline; line-height: 1.3; color: rgb(0, 0, 0); font-variant-ligatures: normal;\" class=\"\">To further test their hardiness, Ingemar Jönsson of Sweden’s Kristianstad University and colleagues&nbsp;<a href=\"https://www.newscientist.com/blog/space/2007/09/water-bears-in-space/\" style=\"box-sizing: border-box; font-family: inherit; text-decoration: none; color: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;\" class=\"\">launched</a>&nbsp;two species of dried-up tardigrades from Kazakhstan in September 2007 aboard ESA’s FOTON-M3 mission, which carried a variety of experimental payloads.</div><p style=\"box-sizing: inherit; font-family: &quot;PT Serif&quot;, Georgia, serif; margin: 0px 0px 0.6875rem; padding: 0px; border: 0px; vertical-align: baseline; line-height: 1.3; color: rgb(0, 0, 0); font-variant-ligatures: normal;\" class=\"\"></p><div id=\"video-mid-article\" class=\"mpu\" data-google-query-id=\"CPDU3Zz9kOsCFQ_auwgd4TgJPw\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-family: &quot;PT Serif&quot;, Georgia, serif; vertical-align: baseline; display: inline; position: absolute; bottom: 0px; right: 0px; color: rgb(0, 0, 0); font-variant-ligatures: normal;\"><div id=\"google_ads_iframe_/21632812681/NewScientist/Article-mid-editorial-video_0__container__\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0pt none; font-family: inherit; vertical-align: baseline;\" class=\"\"><iframe id=\"google_ads_iframe_/21632812681/NewScientist/Article-mid-editorial-video_0\" title=\"3rd party ad content\" name=\"google_ads_iframe_/21632812681/NewScientist/Article-mid-editorial-video_0\" width=\"1\" height=\"1\" scrolling=\"no\" marginwidth=\"0\" marginheight=\"0\" frameborder=\"0\" data-google-container-id=\"4\" data-load-complete=\"true\" style=\"box-sizing: inherit; margin: 0px; padding: 0px; border-width: 0px; font-family: inherit; vertical-align: bottom; width: 1px !important; height: 1px !important;\" class=\"\"></iframe></div></div><p style=\"box-sizing: inherit; font-family: &quot;PT Serif&quot;, Georgia, serif; margin: 0px 0px 0.6875rem; padding: 0px; border: 0px; vertical-align: baseline; line-height: 1.3; color: rgb(0, 0, 0); font-variant-ligatures: normal;\" class=\"\"></p><div style=\"box-sizing: inherit; font-family: &quot;PT Serif&quot;, Georgia, serif; margin: 0px 0px 0.6875rem; padding: 0px; border: 0px; vertical-align: baseline; line-height: 1.3; color: rgb(0, 0, 0); font-variant-ligatures: normal;\" class=\"\">After 10 days of exposure to space, the satellite returned to Earth. The tardigrades were retrieved and rehydrated to test how they reacted to the airless conditions in space, as well as ultraviolet radiation from the Sun and charged particles from space called cosmic rays.</div><div style=\"box-sizing: inherit; font-family: &quot;PT Serif&quot;, Georgia, serif; margin: 0px 0px 0.6875rem; padding: 0px; border: 0px; vertical-align: baseline; line-height: 1.3; color: rgb(0, 0, 0); font-variant-ligatures: normal;\" class=\"\">The vacuum itself seemed to have little effect on the creatures. But ultraviolet radiation, which can damage cellular material and DNA, did take its toll.</div><h2 style=\"box-sizing: border-box; font-size: 16px; margin: 0px 0px 0.93747rem; padding: 0px; border: 0px; font-family: &quot;Titillium Web&quot;, Helvetica, &quot;Trebuchet MS&quot;, Arial, sans-serif; vertical-align: baseline; color: rgb(0, 0, 0); letter-spacing: -0.0375rem; font-variant-ligatures: normal;\" class=\"\">Dried out</h2><div style=\"box-sizing: inherit; font-family: &quot;PT Serif&quot;, Georgia, serif; margin: 0px 0px 0.6875rem; padding: 0px; border: 0px; vertical-align: baseline; line-height: 1.3; color: rgb(0, 0, 0); font-variant-ligatures: normal;\" class=\"\">In one of the two species tested, 68% of specimens that were shielded from higher-energy radiation from the Sun were revived within 30 minutes of being rehydrated. Many of these tardigrades went on to lay eggs that successfully hatched.</div><div style=\"box-sizing: inherit; font-family: &quot;PT Serif&quot;, Georgia, serif; margin: 0px 0px 0.6875rem; padding: 0px; border: 0px; vertical-align: baseline; line-height: 1.3; color: rgb(0, 0, 0); font-variant-ligatures: normal;\" class=\"\">But only a handful of animals survived full exposure to the Sun’s UV light, which is more than 1000 times stronger in space than on the Earth’s surface.</div><div style=\"box-sizing: inherit; font-family: &quot;PT Serif&quot;, Georgia, serif; margin: 0px 0px 0.6875rem; padding: 0px; border: 0px; vertical-align: baseline; line-height: 1.3; color: rgb(0, 0, 0); font-variant-ligatures: normal;\" class=\"\">Before this experiment, only&nbsp;<a href=\"https://www.newscientist.com/article/dn8297-hardy-lichen-shown-to-survive-in-space\" style=\"box-sizing: border-box; font-family: inherit; text-decoration: none; color: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;\" class=\"\">lichen</a>&nbsp;and bacteria were known to be able to survive exposure to the combination of vacuum and space radiation.</div><span style=\"box-sizing: inherit; font-family: &quot;PT Serif&quot;, Georgia, serif; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(0, 0, 0); font-variant-ligatures: normal;\" class=\"\"><br style=\"box-sizing: inherit;\" class=\"\"><br style=\"box-sizing: inherit;\" class=\"\">Read more:&nbsp;<a href=\"https://www.newscientist.com/article/dn14690-water-bears-are-first-animal-to-survive-space-vacuum/#ixzz6UjNMnd9p\" style=\"box-sizing: border-box; font-family: inherit; text-decoration: none; color: rgb(0, 51, 153); margin: 0px; padding: 0px; border: 0px; vertical-align: baseline;\" class=\"\">https://www.newscientist.com/article/dn14690-water-bears-are-first-animal-to-survive-space-vacuum/#ixzz6UjNMnd9p</a></span></span></div></body></html>',NULL,NULL,'2020-08-10 13:46:02','2020-08-18 08:52:53','2020-08-18 08:52:53',NULL,NULL,NULL,NULL,NULL,0,3,NULL,1,NULL,NULL),(55,165,'App\\Client',9,'App\\Company',9,NULL,NULL,NULL,14,2,5,NULL,'Test ticket sorting issue','Hi All,\r\n\r\nI\' am testing the sorting issue.\r\n\r\nGreetings,\r\nSlavica',NULL,NULL,'2020-08-12 10:20:02','2020-08-18 08:52:22','2020-08-18 08:52:22',NULL,NULL,NULL,NULL,NULL,0,1,NULL,1,NULL,NULL),(56,166,'App\\Client',9,'App\\Company',234,NULL,23,9,14,1,2,NULL,'INAX247 Support Request','From / Name: Sarka Cahakova\nFirm / Organisation: Taxedo\nPhone: +447981918156\nMobile: +447981918156\nSoftware/Hardware affected: App (Android)\nWhich Version: ixArma 4\nLast Update: 2018\nBriefly describe your problem: test ticket during the call\n',NULL,NULL,'2020-08-12 13:14:01','2020-08-18 08:52:10','2020-08-18 08:52:10',NULL,NULL,NULL,NULL,NULL,0,2,NULL,1,NULL,NULL),(68,9,'App\\Company',9,'App\\Company',23,NULL,NULL,NULL,9,1,1,NULL,'INAX247 Support Request','From / Name: Hleb Prakhnitski\nFirm / Organisation: Home\nPhone: +375298835475\nMobile: +375298835475\nSoftware/Hardware affected: ixArma\nWhich Version: ixArma 6\nLast Update: 2020\nBriefly describe your problem: BIG TESTS!\n',NULL,NULL,'2020-08-12 13:25:01','2020-08-18 08:54:35','2020-08-18 08:54:35',NULL,NULL,NULL,NULL,NULL,0,3,NULL,1,NULL,NULL),(69,166,'App\\Client',9,'App\\Company',234,NULL,NULL,NULL,14,1,1,NULL,'INAX247 Support Request','From / Name: Sarka Cahakova\nFirm / Organisation: Taxedo\nPhone: +447981918156\nMobile: +447981918156\nSoftware/Hardware affected: App (Android)\nWhich